import React from "react";
import { Switch, Route } from "react-router-dom";
import Header from "./Header";
import Home from "./Home";
import NewDeck from "./NewDeck";
import NotFound from "./NotFound";

function Layout() {
  return (
    <>
      <Header />
      <div className="container">
        <Switch>
          <Route path="/" exact={true}> {/* Home */}
            <Home />
          </Route>
          <Route path="/decks/:deckId/study"> {/* Study */}
          </Route>
          <Route path="/decks/new"> {/* Create Deck */}
            <NewDeck />
          </Route>
          <Route path="/decks/:deckId"> {/* Deck */}
          </Route>
          <Route path="/decks/:deckId/edit"> {/* Edit Deck */}
          </Route>
          <Route path="/decks/:deckId/cards/new"> {/* Add Card */}
          </Route>
          <Route path="/decks/:deckId/cards/:cardId/edit"> {/* Edit Card */}
          </Route>
          <Route> {/* 404 */}
            <NotFound />
          </Route>
        </Switch>

      </div>
    </>
  );
}

export default Layout;
